import React from "react";

const Buzzes = ({ buzz }) => {
  return (
    <div className="">
      <div class="block m-10 rounded-md bg-white p-6 shadow-[0_2px_15px_-3px_rgba(0,0,0,0.07),0_10px_20px_-2px_rgba(0,0,0,0.04)] dark:bg-neutral-700">
        <h5 class="mb-2 text-xl font-medium leading-tight text-neutral-800 dark:text-neutral-50">
          {buzz.name}
        </h5>
        <p class="mb-4 text-base text-neutral-600 dark:text-neutral-200">
        {buzz.message}
        </p>
      </div>
    </div>
  );
};

export default Buzzes;
